import React from 'react';
import './product-checkout.styles.css';
import { DeleteOutlined, LeftCircleOutlined, RightCircleOutlined } from '@ant-design/icons';
import { Button } from 'antd';

const ProductCheckOut = () => (
  <div className="product-container">
    <div className="product-infor">
      <img
        width={100}
        height={100}
        alt=" PRODUCT"
        src="https://i.pinimg.com/736x/26/58/b1/2658b16da86d5427f65ad2476739734b.jpg"
      />
      <div className="product-title">
        <h2>Patient Ninja</h2>
        <p style={{ fontSize: '24px' }}>35$</p>
      </div>
    </div>
    <div className="product-quantity">
      <RightCircleOutlined style={{ fontSize: '16px' }} />
        <p style={{ fontSize: '36px' }} >3</p>
      <LeftCircleOutlined style={{ fontSize: '16px' }} />
    </div>
    <div className="product-delete">
      <Button type="primary" icon={<DeleteOutlined style={{ fontSize: '24px' }} />} />

    </div>
  </div>
);
export default ProductCheckOut;
